message.content:
{
  "advertisements": [
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "16. Bey Herrn Rudolf Ramsperger an der Huthgass ist extra guter Holländer-Taback in kleineren Pfund- Büchsen à 10 Ragen, wie auch guter St. Vincent à 8 Rg. zu haben."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "17. Wo guter Art grosse Boden zum Sehen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "18. Zwei Barettlein oder Prefeßor-Hüte, wie auch ein ganz neuer Castor- Hut, mittelmäßiger Größe, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "19. Bey Herrn Burckhardt zum Kiepen sind extra neue grosse Italiänische Zeigen, dito grosse Meertrauben mit und ohne Stiel, Haselnüsse, dürre Morscheln, feiner Chocoladen, alles in billigem Preis zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "20. Zwoß Säck neuer Batiten in billigem Preis, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "21. Bey Herrn Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 65 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2.) Die Welt in einer Kug mit Kupfern. 3.) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4.) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "22. Zwei faubere französische Betber in ein Births-Haus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "23. Eine Behauffung in der Weichemer Vorstadt mit 4 Stuben, 5 Kammern samt einer großen Werkstatt, Eßrig und einem schönen ge- wölbten Keller und Garten, weshalb sich bey Herrn Jacob Maglin dem Weinnmann anzumelden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "24. Ein Freund, welcher circa 600 Secker Hanf-Saamen anheber liefern könnte, möchte aber solchen vorhero verkaufft wissen, offeriert selbigen dahero in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mür. Michael Zuch dem Kiefer zu vernehmen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "26. Circa 6. Saun extra guter aller vor roßer Pflecker- Wein, so gut als Fleenburger oder Burgunder, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "27. Zwei Stücklein weissen Weins von 1760. 8 Pfund 10 ƒ der Saum im einen, und 8 Pfund im andern, wovon nach Belieben zu haben, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "28. Ein Stock Heu ab 3 Thalen Matten vorin Riechemer Thor oberhalb der Schorenbruck. Ferner ein Stücklein von 7 Saamen rothen Hölziger-Wein von 1760. schön roth und lauter, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "29. Auf C. E. Junst zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "31. Im Offenburger Hof ist wohlverwahrter Bau zu haben."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "32. Ein Brennbaudlein bey der Steinen-Mühlin mit aller Kommünickeit, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "33. Bey weime vother und weisser Burgunder wie auch Muskat-Wein, Biecenweiss wegen Mangel Vlakes, wie auch roth und weisser 1-532er Margräfer-Wein in billigem Preis zu haben, ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "34. Feine heitergelbe Hamburger-Strieß-Mollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "35. Herren Hophach des Siegriffs Behauffung ins Spieg-Ischlein mit 4 Stuben, 3 Kammern sc. ist entweder zu verkaufen, oder samelhaft zu verleihen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "36. Weisse und rothe Margräfer-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "37. Ein Mannensitz in St. Peters Kirch auf dem Letner. Item ein grün Tombrau-Bechlein mit grünen wellen den Umhängen, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "38. Ein Haushschtitten mit einem schönen Bild und Zugehörd in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "39. Der Bärenkeller-Hof zu St. Peter, mit Garten, Stallung, Keller sc. wie der Augenschein zeigen wird. In Ermanglung eines Käufers"
    }
  ]
}
